import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Home from './Home';

function App() {
  return (
    <Router>
      <div className="App">
        <div className='content'>
          <h1>Kaylea Gray</h1>
          <Switch>
            <Route path='/'>
              <Home />

            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
